using Amazon;
using Amazon.Lambda;
using Amazon.Lambda.Model;
using Amazon.Runtime;
using System;
using System.IO;
using System.Threading.Tasks;

namespace Raw2Parsed.Tests
{
    public class LocalRunner
    {
        public static string RawOutput;

        public string FetchRawOutput()
        {
            PDF2Raw().GetAwaiter().GetResult();
            return RawOutput;
        }

        async Task PDF2Raw()
        {
            string PDF10316 = "";
            string PDF10379 = "";
            var credentials = new StoredProfileAWSCredentials("LinkLiang");
            using (var client = new AmazonLambdaClient(credentials, RegionEndpoint.USEast1))
            {
                var request = new InvokeRequest
                {
                    FunctionName = "PDF2Raw",
                    Payload = "\""+ PDF10379 + "\""
                };
                var response = await client.InvokeAsync(request);
                
                using (var sr = new StreamReader(response.Payload))
                {
                    RawOutput = sr.ReadToEnd();
                    File.WriteAllText("RawOutput", RawOutput);
                    var Parser = new Functions().SelectCustomer(RawOutput);
                    string result = Parser.Parse(RawOutput);
                    File.WriteAllText("output", result);
                }
            }
            Console.WriteLine("Hello World!");
        }
    }
}
